{'format': 'Raster Dataset', 'unit': '%', 'dataType': 'Byte (8bit Integer)', 'noDataValue': 255, 'spatialResolution': '100m (0.000992 degree)', 'spatialExtent': 'Africa and Near East', 'spatialReferenceSystem': 'EPSG:4326 - WGS84 - Geographic Coordinate System (lat/long)', 'temporalResolution': 'from January 2009 to present', 'temporalExtent': 'Long Term (2009 to date)', 'methodology': 'The long-term NDVI quality layer is produced as a summary of the quality for the entire time period (2009-2019). Pixel values indicate the percentage of good NDVI observations over the entire time period.

